import React from 'react';


const Items = (props)  => {
    return(<h1>Header text from Items component {props.quantity}</h1>)
}


Items.defaultProps = {
    quantity:0
}

class ShoppingCart extends React.Component {
    constructor(props){
        super(props);
    }

    render(){
        return <Items />
    }

}

export default ShoppingCart;
